const assessments = []

function createAssessment () {
    const firstName = MU.getRandomArrayElement(firstNames)
    const lastName = MU.getRandomArrayElement(lastNames)
    const type = MU.getRandomArrayElement(assessmentTypes)
    const status = MU.getRandomArrayElement(assessmentStatuses)

    const day = 1000 * 60 * 60 * 24
    const week = day * 7
    const month = week * 4
    const year = day * 365

    const dateStarted = new Date().getTime() - MU.getRandomInt(day, year)

    return {
        typeName: type.name,
        typeTitle: type.title,
        statusName: status.name,
        statusTitle: status.title,
        dateStarted: dateStarted,
        dateCompleted: status.name === 'COMPLETED' ? (dateStarted + MU.getRandomInt(day, month)) : null,
        author: `${firstName} ${lastName}`
    }
}

function createAssessments () {
    const totalCount = 45

    for (let i = 0; i < totalCount; i++) {
        assessments.push({id: i, ...createAssessment()})
    }
}

createAssessments()


