export function login ({ companyId, username, password }) {
    const { demoUsers } = config;

    if (where(demoUsers, { isActive: true }).length) {
        const users = where(demoUsers, { companyId })

        if (users.length) {
            const user = findWhere(users, { username })

            if (user) {
                if (password === user.password) {
                    return getSuccessResponse(findWhere(persons, { id: user.id }), { success: true })
                }
                return getFailureResponse('invalid.password', 'Sorry, your password is incorrect. Please try again.')
            }
            return getFailureResponse('invalid.login', 'Specified login does not exist')
        }
        return getFailureResponse('invalid.company.id', 'Specified company does not exist')
    }
    return getFailureResponse('no.active.demo.users', 'No any active demo user')
}

export function logout () {
    return getSuccessResponse(null, { success: true })
}

