export function getCommunities(params) {

    const { page, size } = params

    let result = map(communities, o => {
        const oid = MU.getRandomArrayElement(['United Health Group','Mc Kesson','Amerisource Bergen'])
        const createdAutomatically = MU.getRandomArrayElement([true, false])

        return {
            ...o,
            oid,
            createdAutomatically,
            lastModified: new Date().getTime() - MU.getRandomInt(0, 1000 * 60 * 60 * 24 * 365 * 5)
        }
    })

    result = filter(result, (o, i) => {
        const start = page * size
        const end = start + size
        return i >= start && i < end
    })

    return getSuccessResponse(result, { totalCount: communities.length })
}

