const assessmentHistory = []

function createAssessmentHistoryItem () {
    const firstName = MU.getRandomArrayElement(firstNames)
    const lastName = MU.getRandomArrayElement(lastNames)
    const type = MU.getRandomArrayElement(assessmentTypes)
    const status = MU.getRandomArrayElement(assessmentStatuses)

    const day = 1000 * 60 * 60 * 24
    const week = day * 7
    const month = week * 4
    const year = day * 365

    const date = new Date().getTime() - MU.getRandomInt(day, year)

    return {
        typeName: type.name,
        typeTitle: type.title,
        statusName: status.name,
        statusTitle: status.title,
        date,
        author: `${firstName} ${lastName}`
    }
}

function createAssessmentHistory () {
    const totalCount = 55

    for (let i = 0; i < totalCount; i++) {
        assessmentHistory.push({id: i, ...createAssessmentHistoryItem()})
    }
}

createAssessmentHistory()

