export function getInsuranceNetworks() {
    return getSuccessResponse(map(insuranceNetworkTitles, (title, id) => {
        const paymentPlans = []
        const n = MU.getRandomInt(0, 5)

        for (let i = 0; i < n; i++) {
            const t = MU.getRandomArrayElement(insurancePaymentPlanTitles)

            paymentPlans.push({
                id: i,
                title: t,
                label: t,
                isPopular: MU.getRandomInt(0, 9) < 2
            })
        }

        return {id, label: title, title, isPopular: MU.getRandomInt(0, 9) < 2, paymentPlans}
    }), {
        success: true,
        totalCount: insuranceNetworkTitles.length
    })
}

export function getInsurancePaymentPlans() {
    const plans = []

    for (let i = 0; i < insurancePaymentPlanTitles.length; i++) {
        plans.push({
            id: i,
            isPopular: MU.getRandomInt(0, 9) < 2,
            label: insurancePaymentPlanTitles[i],
            title: insurancePaymentPlanTitles[i]
        })
    }

    return getSuccessResponse(plans, { success: true })
}

